import React from "react";

class Navbar extends React.Component {
  render() {
    return (
      <nav className="navbar bg-primary">
        <a href="/">
          <h1>
            <i className="fab fa-github"></i>
          </h1>
        </a>
        <ul>
          <li>
            <a href="/home"></a>
          </li>
        </ul>
      </nav>
    );
  }
}

export default Navbar;
